    /**
     * @covers ::getBlockchainConfig
     */
    public function testGetBlockChainConfig(): void
    {
        $boc = '';

        $expected = new ResultOfGetBlockchainConfig(
            new Response(
                [
                    'config_boc' => '',
                ]
            )
        );

        self::assertEquals($expected, $this->boc->getBlockchainConfig($boc));
    }

    /**
     * @covers ::parseShardstate
     */
    public function testParseShardstate(): void
    {
        $boc = '';
        $id = 'zerostate:-1';
        $workcahinId = -1;

        $resultOfParse = $this->boc->parseShardstate($boc, $id, $workcahinId);
        $parsed = $resultOfParse->getParsed();

        self::assertEquals($boc, $parsed['boc']);
        self::assertEquals($id, $parsed['id']);
        self::assertEquals($workcahinId, $parsed['workchain_id']);
        self::assertEquals(0, $parsed['seq_no']);
    }

